INSERT INTO `xmw_international` VALUES ('b5428a9d-bf04-48db-bf28-6d61ebead9ac', 'subTitle', 'a887b890-bf1c-46f5-90a3-6a30da04d515', '验证码的主要用途是为了防止自动化程序（如机器人、爬虫等）恶意访问网站或应用程序，从而保护系统的安全性和数据的完整性，单纯前端的验证是不安全的，因为可以直接通过接口请求', 'The main purpose of captCHA is to prevent automated programs (such as robots, crawlers, etc.) from accessing websites or applications maliciously, so as to protect the security of the system and the i', 'captchaの主な用途は、自動化プログラム(ロボット、クローラなど)がウェブサイトやアプリケーションに悪意を持ってアクセスするのを防ぎ、システムの安全性とデータの完全性を保護するためです。フロントエンドの検証だけでは、インターフェイス上で直接要求できるので安全ではありません', '驗證碼的主要用途是為了防止自動化程序（如機器人、爬蟲等）惡意訪問網站或應用程序，從而保護系統的安全性和數據的完整性，單純前端的驗證是不安全的，因為可以直接通過接口請求', 'bf75a509-f90e-4a29-8bf7-470b581550f6', 1, '2024-10-10 17:33:53', '2024-10-10 17:33:53');
